import React from 'react'

const SearchImage = () => {
    const styles ={
        maindiv:{

            marginTop:'50px',
            display:'flex',
            justifyContent:'center',
        }
    }
    const url = 'https://source.unsplash.com/random/400x400'
  return (
    <div>
        <div style={styles.maindiv} className="mainDiv">
        <label htmlFor="">Get Images : </label>
            <input type="text" />
        </div>
        <img src={url} alt="" />
    </div>
  )
}

export default SearchImage
